import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import API from '../api';

export default function CoursePage() {
  const { id } = useParams();
  const [course, setCourse] = useState(null);
  const [sections, setSections] = useState([]);
  const [videos, setVideos] = useState([]);
  const [selectedVideoId, setSelectedVideoId] = useState(null);

  useEffect(() => {
    API.get('/courses/' + id).then((r) => {
      setCourse(r.data.course);
    });
  }, [id]);

  const handleEnroll = async () => {
    await API.post(`/courses/${id}/enroll`);
    const res = await API.get(`/courses/${id}/sections`);
    setSections(res.data);
  };

  const loadVideos = async (sectionId) => {
    const res = await API.get(`/courses/section/${sectionId}/videos`);
    setVideos(res.data);

    // Auto-load first video
    if (res.data.length > 0) {
      setSelectedVideoId(res.data[0]._id);
    }
  };

  return (
    <div className="container mt-4">
      {!course ? (
        <p>Loading...</p>
      ) : (
        <>
          <h2>{course.title}</h2>
          <p>{course.description}</p>

          <button className="btn btn-success mb-3" onClick={handleEnroll}>
            Enroll
          </button>

          <div className="row">

            {/* LEFT â€” Sections */}
            <div className="col-md-4">
              <h5>Sections</h5>
              <ul className="list-group">
                {sections.map((s) => (
                  <li key={s._id} className="list-group-item">
                    <button
                      className="btn btn-link p-0"
                      onClick={() => loadVideos(s._id)}
                    >
                      {s.title}
                    </button>
                  </li>
                ))}
              </ul>

              {/* Video list */}
              <h6 className="mt-3">Videos</h6>
              <ul className="list-group">
                {videos.map((v) => (
                  <li
                    key={v._id}
                    className="list-group-item"
                    style={{ cursor: 'pointer' }}
                    onClick={() => setSelectedVideoId(v._id)}
                  >
                    ðŸŽ¬ {v.title}
                  </li>
                ))}
              </ul>
            </div>

            {/* RIGHT â€” Video Player */}
            <div className="col-md-8">
              {selectedVideoId ? (
                <iframe
                  className="w-100"
                  style={{ height: 400 }}
                  src={`/api/courses/video/${selectedVideoId}`}
                  title="course-video"
                  allow="fullscreen"
                ></iframe>
              ) : (
                <p>Select a section, then a video.</p>
              )}
            </div>

          </div>
        </>
      )}
    </div>
  );
}
